import React, { useState } from "react";
import { Link } from "react-router-dom";

import classes from "./VideoParameterPage.module.scss";
import TopBar from "../../components/TopBar/TopBar";
import SelectedActivities from "../../components/SelectedActivities/SelectedActivities";
import VideoParameterInfo from "../../components/VideoParameterInfo/VideoParameterInfo";

const VideoParameterPage = (props) => {
  return (
    <>
      <TopBar />
      <div className={classes.videoParamaters}>
        <div className={classes.content}>
          <SelectedActivities selected={props.activities} />
          <VideoParameterInfo />
        </div>
        <div className={classes.routeButtons}>
          <button className={classes.back}>
            <Link
              className={classes.linkBack}
              to={{
                pathname: "/activity-parameters",
              }}
            >
              Back
            </Link>
          </button>
        </div>
      </div>
    </>
  );
};

export default VideoParameterPage;
